import React from "react";
import { FrontPageStyle } from "../../styles/FrontPageStyle/FrontPage.style.ts";
import NavBar from "./NavBar/NavBar.tsx";
import Welcome from "./Welcome.tsx";

function FrontPage() {
  return (
    <FrontPageStyle>
      <NavBar />
      <Welcome />
    </FrontPageStyle>
  );
}

export default FrontPage;
